var myNinjaApp = angular.module('myNinjaApp', ['ngRoute']);

myNinjaApp.config(['$routeProvider', function ($routeProvider) {

  $routeProvider
    .when('/home', {
      templateUrl: 'views/home.html',
      controller: 'NinjaController'
    })
    .when('/directory', {
      templateUrl: 'views/directory.html',
      controller: 'NinjaController'
    }).otherwise({
      redirectTo: '/home'
    })
}])

myNinjaApp.directive('randomNinja', [function () {
  return {
    // this is where we define our functionality
    // E - can be used as an element, A - can be used as an attribute
    restrictive: 'E',
    scope: {
      // = means it is binding the data together
      ninjas: '=',
      title: '='
    },
    templateUrl: 'views/random.html',
    transclude: true,
    // set the replace to true to control the name of the custom directive tag to be replaced with a div tag. This is more standard compliant
    replace: true,
    controller: function ($scope) {
      $scope.random = Math.floor(Math.random() * 4);
    }
  };
}])

// we put the function and scope in an array to protect it from code minification changes
myNinjaApp.controller('NinjaController', ['$scope', function ($scope) {
  $scope.message = 'hello world'
  $scope.removeNinja = function (ninja) {
    var removedNinja = $scope.ninjas.indexOf(ninja);
    $scope.ninjas.splice(removedNinja, 1)
  }

  $scope.addNinja = function () {
    $scope.ninjas.push({
      name: $scope.newninja.name,
      belt: $scope.newninja.belt,
      rate: parseInt($scope.newninja.rate),
      available: true
    });

    $scope.newninja.name = '';
    $scope.newninja.belt = '';
    $scope.newninja.rate = '';
  }

  $scope.ninjas = [
    {
      name: 'yoshi',
      belt: 'Green',
      rate: 50,
      available: true,
      thumb: "data:image/jpeg;base64,"
    }, {
      name: 'crystal',
      belt: 'Yellow',
      rate: 30,
      available: true,
      thumb: "data:image/jpeg;base64,"
    }, {
      name: 'ryu',
      belt: 'Orange',
      rate: 45,
      available: true,
      thumb: "data:image/jpeg;base64,"
    }, {
      name: 'shaun',
      belt: 'Black',
      rate: 20,
      available: true,
      thumb: "https://supermariorun.com/assets/img/hero/hero_chara_mario_update_pc.png"
    }];
}]);

